import React, { useState, Fragment, useEffect } from "react";
import { useSelector, useDispatch } from "react-redux";

import { OrderForm } from '../cmps/OrderForm.jsx'

export function Order() {
  const { mediaType, mediaLink ,orderDetails } = useSelector((state) => state.mediaModule);

  const initialUserDetails = {
    type: mediaType,
    link: mediaLink,
    order: orderDetails,
  };
  const [userDetails, setUserDetails] = useState(initialUserDetails);

  return (
    <Fragment>
      <h2>Order page</h2>
      <div>
        <h3>פרטי ההזמנה</h3>
        <h4>{userDetails.type} :סוג</h4>
        <h4>{userDetails.link} :לינק</h4>
      </div>
      <OrderForm></OrderForm>
      {/* <button> --רכוש עכשיו</button> */}
      //לשלוח את המידע לדאטה בייס לשמור במערך הזמנות ובו זמנית לעבור לעמוד תשלום
    </Fragment>
  );
}
